public class Solution {
    public int DistributeCandies(int n, int limit) {
        int[,,] dp = new int[n + 1, limit + 1, limit + 1];

        // Initialize for zero candies
        dp[0, 0, 0] = 1;

        for (int i = 0; i <= n; i++) {
            for (int j = 0; j <= limit; j++) {
                for (int k = 0; k <= limit; k++) {
                    // If there are no more candies to distribute
                    if (i == 0) continue;

                    // Distribute to the first child
                    if (j > 0 && i - j >= 0) {
                        dp[i, j, k] += dp[i - j, j, k];
                    }

                    // Distribute to the second child
                    if (k > 0 && i - k >= 0) {
                        dp[i, j, k] += dp[i - k, j, k];
                    }

                    // Distribute to the third child
                    if (i <= limit && i - j - k <= limit && i - j - k >= 0) {
                        dp[i, j, k] += dp[i, j, k];
                    }
                }
            }
        }

        int totalWays = 0;
        for (int j = 0; j <= limit; j++) {
            for (int k = 0; k <= limit; k++) {
                totalWays += dp[n, j, k];
            }
        }

        return totalWays;
    }
}
